import {createAPI} from "@novorender/webgl-api";
import React, {useEffect} from 'react';
import {main} from "./condos";

export const Condo = () => {
  const api = createAPI({
    // Path to where the files previously copied from node_modules are hosted
    scriptBaseUrl: `${window.location.origin}/novorender/webgl-api/`,
  });
  const canvas = document.querySelector<HTMLCanvasElement>("#canvas")!;

  useEffect(() => {

    const fetchData = async () => {
      const data = await main(api, canvas);
      console.log(data)
    }

    // call the function
    fetchData()
      // make sure to catch any error
      .catch(console.error);
  }, [])

  return (
      <>
        <h1>Hello</h1>
      <canvas id="canvas"></canvas>
        {main(api, canvas)}
      </>
  );
}
